import React, { useState, useEffect } from "react";
import InfiniteScroll from "react-infinite-scroller";
import axios from "axios";

const ViewData = () => {
  const [entries, setEntries] = useState([]); // State to hold fetched entries
  const [dateList, setDateList] = useState([]); // List of dates in the specified month
  const [loading, setLoading] = useState(false); // State to handle loading
  const [currentIndex, setCurrentIndex] = useState(0); // Track current index for dates to fetch
  const fetchedDates = new Set(); // Set to track fetched dates

  // Generate all dates for the specified month and year
  useEffect(() => {
    const year = 2024; // Specify the year
    const month = 9; // Specify the month (0 = January, 1 = February, etc.)

    const dates = [];
    const daysInMonth = new Date(year, month + 1, 0).getDate();
    for (let i = 1; i <= daysInMonth; i++) {
      const date = new Date(year, month, i);
      dates.push(date.toISOString().substr(0, 10)); // Format date as YYYY-MM-DD
    }
    setDateList(dates);
  }, []);

  // Function to fetch data by date and email
  const fetchDataByDateAndEmail = async (entryDate, email) => {
    try {
      const response = await axios.get(`http://localhost:5000/api/diary/get-entry`, {
        params: { entryDate, email },
      });
      // Return the date and imageUrl; if not available, return a placeholder
      return {
        date: entryDate,
        imageUrl: response.data.imageUrl || null,
      };
    } catch (error) {
      console.error(`Error fetching data for ${entryDate}:`, error);
      return { date: entryDate, imageUrl: null };
    }
  };

  // Load data for the next set of dates
  const loadEntries = async () => {
    if (loading || currentIndex >= dateList.length) return; // Prevent concurrent requests and check index

    setLoading(true);
    const email = localStorage.getItem("email");
    const newEntries = [];
    const endIndex = Math.min(currentIndex + 5, dateList.length); // Fetch up to 5 new dates

    for (let i = currentIndex; i < endIndex; i++) {
      const entryDate = dateList[i];
      if (!fetchedDates.has(entryDate)) { // Only fetch if this date hasn't been fetched yet
        const entry = await fetchDataByDateAndEmail(entryDate, email);
        if (entry.imageUrl !== null) { // Only add if an image exists
          newEntries.push(entry);
          fetchedDates.add(entryDate); // Mark this date as fetched
        }
      }
    }

    // Add new unique entries to the state
    setEntries((prevEntries) => [
      ...prevEntries,
      ...newEntries.filter(entry => !prevEntries.some(prev => prev.date === entry.date)), // Only add unique entries
    ]);
    
    setCurrentIndex(endIndex); // Update the current index
    setLoading(false);
  };

  // Automatically load entries when the component mounts
  useEffect(() => {
    loadEntries();
  }, [dateList]); // Load initial entries when dateList changes

  return (
    <div style={{ width: "90%", margin: "0 auto", paddingTop: "20px" }}>
      <InfiniteScroll
        pageStart={0}
        loadMore={loadEntries}
        hasMore={currentIndex < dateList.length} // Allow loading more if we haven't reached the end
        loader={
          <div style={{ textAlign: "center", margin: "20px 0" }} key={0}>
            Loading ...
          </div>
        }
      >
        <div style={{ display: "flex", flexWrap: "wrap", justifyContent: "center" }}>
          {entries.map((entry) => (
            <div
              key={entry.date}
              style={{
                border: "1px solid #ddd",
                borderRadius: "10px",
                width: "30%", // Set width to 30% for 3 items per row
                margin: "10px 20px", // Increased left and right margins
                textAlign: "center",
                boxShadow: "0 4px 8px rgba(0, 0, 0, 0.1)",
                overflow: "hidden", // Prevent overflow
              }}
            >
              {entry.imageUrl ? (
                <img
                  src={entry.imageUrl}
                  alt={`Diary entry for ${entry.date}`}
                  style={{
                    width: "100%",
                    height: "200px", // Fixed height for all images
                    objectFit: "cover", // Cover the area, maintaining aspect ratio
                    borderTopLeftRadius: "10px",
                    borderTopRightRadius: "10px",
                  }}
                />
              ) : (
                <div style={{ padding: "20px", color: "#888", height: "200px", display: "flex", alignItems: "center", justifyContent: "center" }}>
                  No image available for {entry.date}
                </div>
              )}
              <div style={{ padding: "10px" }}>
                <h5 style={{ margin: "10px 0", fontSize: "1.1em" }}>{entry.date}</h5>
              </div>
            </div>
          ))}
        </div>
      </InfiniteScroll>
    </div>
  );
};

export default ViewData;
